import React from "react";
import "./StartPage.css";

function StartPage() {
  return (
    <div className="Background">
      <div className="WhiteBox">
        <div className="TitleDiv">
            <div className="MetaIcon"></div>
            <div className="TitleText">Meta-PoP</div>
        </div>
      </div>
    </div>
  );
}

export default StartPage;
